import * as React from 'react';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

function HeroHome() {
  return (
    <>
          <Container maxWidth="1600" 
    sx={{
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      height: '100vh',
    }}>
      <Box sx={{ 
        padding: '1em',
        display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center'
        }}>
          <Typography sx={{ 
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '5em', 
            fontWeight: '600',
            color: 'primary.dark'}}>
              GYMBRO</Typography>
          <Typography sx={{ 
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '3em', 
            fontWeight: '400',
            marginTop: '1em',
            color: 'primary.dark'}}>
              The best way to build your training plan</Typography>
          <Button variant="contained" href="/CreateRoutine" sx={{ 
            backgroundColor: 'primary.main',
            marginTop: '1em',
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '3em', 
            fontWeight: '500',
            width: '40%',
            borderRadius: '20px',
            }}>USE NOW!</Button>
          </Box>
      </Container>
    </>
  );
}

export default HeroHome
